import styled from 'styled-components';

export const Container = styled.div`
  height: 398px;
  background: #e5e5e5;
`;

export const Inputs = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;

  p {
    font-size: 12px;
  }

  input {
    background-color: #f5f5f7 !important;
    margin: 0.5em;
  }
`;
